pragma solidity >=0.4.21 <0.7.0;

contract Evoucher {
    struct evoucher {
        string token;
        string price;
        string issue_from;
        string issue_until;
        string redeem_date;
        bool isDeleted;
    }
    mapping(string => evoucher) evoucherList;
    uint256 public totalEvouchers;
    constructor() public {
        totalEvouchers = 0;
    }
    function getVoucher(string memory _token) public view returns (
                    string memory token,
                    string memory price,
                    string memory issue_from,
                    string memory issue_until,
                    string memory redeem_date,
                    bool isDeleted){
        return (evoucherList[_token].token,
                evoucherList[_token].price,
                evoucherList[_token].issue_from,
                evoucherList[_token].issue_until,
                evoucherList[_token].redeem_date,
                evoucherList[_token].isDeleted);
    }
    function insert(string memory _token,
                    string memory _price,
                    string memory _issue_from,
                    string memory _issue_until,
                    string memory _redeem_date)
                    public returns (bool success) {
        bool _isDeleted = false;
        evoucher memory newVoucher = evoucher(_token, _price, _issue_from, _issue_until, _redeem_date, _isDeleted);
        evoucherList[_token] = newVoucher;
        totalEvouchers++;
        return true;
    }
    function update(string memory _token,
                    string memory _price,
                    string memory _issue_from,
                    string memory _issue_until,
                    string memory _redeem_date)
                    public returns (bool success) {
        if(compareStrings(_token, "")) {
            evoucherList[_token].token = _token;
        }
        if(compareStrings(_price, "")) {
            evoucherList[_token].price = _price;
        }
        if(compareStrings(_issue_from, "")) {
            evoucherList[_token].issue_from = _issue_from;
        }
        if(compareStrings(_issue_until, "")) {
            evoucherList[_token].issue_until = _issue_until;
        }
        if(compareStrings(_redeem_date, "")) {
            evoucherList[_token].redeem_date = _redeem_date;
        }
        return true;
    }
    function deleteVoucher(string memory _token) public returns (bool success) {
        evoucherList[_token].isDeleted = true;
        return true;
    }
    function compareStrings(string memory a, string memory b)  internal pure returns (bool){
       return keccak256(bytes(a)) == keccak256(bytes(b));
   }
}
